import React, { useState } from 'react';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitStatus, setSubmitStatus] = useState(null);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    // Simulate form submission
    setTimeout(() => {
      setIsSubmitting(false);
      setSubmitStatus('success');
      setFormData({ name: '', email: '', subject: '', message: '' });

      // Reset status after 3 seconds
      setTimeout(() => setSubmitStatus(null), 3000);
    }, 1000);
  };

  const contactInfo = [
    {
      icon: "üìß",
      title: "Email",
      value: "divleen2@gmail.com",
      link: "mailto:divleen2@gmail.com"
    },
    {
      icon: "üì±",
      title: "Phone",
      value: "(669) 243-5546",
      link: "tel:+16692435546"
    },
    {
      icon: "üìç",
      title: "Location",
      value: "Milpitas, CA",
      link: "#"
    },
    {
      icon: "üíº",
      title: "LinkedIn",
      value: "divleen-lota",
      link: "https://www.linkedin.com/in/divleen-lota/"
    }
  ];

  return (
    <section id="contact" className="py-20 px-4 sm:px-6 lg:px-8 bg-dark-surface">
      <div className="max-w-7xl mx-auto">
        <div className="text-center mb-16">
          <h2 className="text-4xl sm:text-5xl font-bold text-text-primary mb-4">
            Get In <span className="gradient-text">Touch</span>
          </h2>
          <p className="text-xl text-text-secondary max-w-3xl mx-auto">
            Ready to collaborate on your next project? Let's discuss how we can create something amazing together.
          </p>
        </div>

        <div className="grid lg:grid-cols-2 gap-12">
          {/* Contact Information */}
          <div className="space-y-8">
            <div>
              <h3 className="text-2xl font-bold text-text-primary mb-6">
                Let's Start a Conversation
              </h3>
              <p className="text-text-secondary leading-relaxed mb-8">
                I'm always excited to work on new projects and collaborate with like-minded individuals. 
                Whether you have a specific project in mind or just want to chat about technology, 
                I'd love to hear from you.
              </p>
            </div>

            {/* Contact Cards */}
            <div className="space-y-4">
              {contactInfo.map((info, index) => (
                <a
                  key={index}
                  href={info.link}
                  target={info.link.startsWith('http') ? '_blank' : '_self'}
                  rel={info.link.startsWith('http') ? 'noopener noreferrer' : ''}
                  className="flex items-center space-x-4 p-4 bg-dark-card rounded-xl border border-gray-800 hover:border-accent-blue/50 hover:bg-dark-card/80 transition-all duration-300 group"
                >
                  <div className="w-12 h-12 bg-gradient-to-r from-accent-blue to-accent-purple rounded-lg flex items-center justify-center text-xl group-hover:scale-110 transition-transform">
                    {info.icon}
                  </div>
                  <div>
                    <h4 className="text-text-primary font-semibold group-hover:text-accent-blue transition-colors">
                      {info.title}
                    </h4>
                    <p className="text-text-secondary group-hover:text-text-primary transition-colors">
                      {info.value}
                    </p>
                  </div>
                </a>
              ))}
            </div>

            {/* Quick Response Promise */}
            <div className="bg-gradient-to-r from-accent-blue/10 to-accent-purple/10 p-6 rounded-xl border border-accent-blue/20">
              <h4 className="text-lg font-semibold text-text-primary mb-2">
                ‚ö° Quick Response
              </h4>
              <p className="text-text-secondary text-sm">
                I typically respond to messages within 24 hours. For urgent matters, 
                feel free to call or text directly.
              </p>
            </div>
          </div>

          {/* Contact Form */}
          <div className="bg-dark-card p-8 rounded-xl border border-gray-800">
            <h3 className="text-2xl font-bold text-text-primary mb-6">
              Send me a Message
            </h3>

            <form onSubmit={handleSubmit} className="space-y-6">
              <div className="grid md:grid-cols-2 gap-6">
                <div>
                  <label htmlFor="name" className="block text-sm font-medium text-text-primary mb-2">
                    Name *
                  </label>
                  <input
                    type="text"
                    id="name"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                    className="w-full px-4 py-3 bg-dark-surface border border-gray-700 rounded-lg text-text-primary placeholder-text-muted focus:border-accent-blue focus:ring-2 focus:ring-accent-blue/20 focus:outline-none transition-all duration-300"
                    placeholder="Your name"
                  />
                </div>
                <div>
                  <label htmlFor="email" className="block text-sm font-medium text-text-primary mb-2">
                    Email *
                  </label>
                  <input
                    type="email"
                    id="email"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                    className="w-full px-4 py-3 bg-dark-surface border border-gray-700 rounded-lg text-text-primary placeholder-text-muted focus:border-accent-blue focus:ring-2 focus:ring-accent-blue/20 focus:outline-none transition-all duration-300"
                    placeholder="your.email@example.com"
                  />
                </div>
              </div>

              <div>
                <label htmlFor="subject" className="block text-sm font-medium text-text-primary mb-2">
                  Subject *
                </label>
                <input
                  type="text"
                  id="subject"
                  name="subject"
                  value={formData.subject}
                  onChange={handleChange}
                  required
                  className="w-full px-4 py-3 bg-dark-surface border border-gray-700 rounded-lg text-text-primary placeholder-text-muted focus:border-accent-blue focus:ring-2 focus:ring-accent-blue/20 focus:outline-none transition-all duration-300"
                  placeholder="What's this about?"
                />
              </div>

              <div>
                <label htmlFor="message" className="block text-sm font-medium text-text-primary mb-2">
                  Message *
                </label>
                <textarea
                  id="message"
                  name="message"
                  value={formData.message}
                  onChange={handleChange}
                  required
                  rows={6}
                  className="w-full px-4 py-3 bg-dark-surface border border-gray-700 rounded-lg text-text-primary placeholder-text-muted focus:border-accent-blue focus:ring-2 focus:ring-accent-blue/20 focus:outline-none transition-all duration-300 resize-none"
                  placeholder="Tell me about your project or idea..."
                />
              </div>

              <button
                type="submit"
                disabled={isSubmitting}
                className={`w-full py-4 px-6 rounded-lg font-semibold text-lg transition-all duration-300 transform ${
                  isSubmitting
                    ? 'bg-gray-600 cursor-not-allowed'
                    : 'bg-gradient-to-r from-accent-blue to-accent-purple text-white hover:shadow-xl hover:shadow-blue-500/25 hover:scale-105'
                }`}
              >
                {isSubmitting ? (
                  <span className="flex items-center justify-center">
                    <svg className="animate-spin -ml-1 mr-3 h-5 w-5 text-white" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                      <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                      <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                    </svg>
                    Sending...
                  </span>
                ) : (
                  'Send Message'
                )}
              </button>

              {submitStatus === 'success' && (
                <div className="p-4 bg-green-500/20 border border-green-500/30 rounded-lg text-green-400 text-center">
                  ‚úÖ Message sent successfully! I'll get back to you soon.
                </div>
              )}
            </form>
          </div>
        </div>

        {/* Additional CTA */}
        <div className="text-center mt-16">
          <div className="bg-gradient-to-r from-accent-blue/10 to-accent-purple/10 p-8 rounded-xl border border-accent-blue/20">
            <h3 className="text-2xl font-bold text-text-primary mb-4">
              Prefer a Different Approach?
            </h3>
            <p className="text-text-secondary mb-6 max-w-2xl mx-auto">
              I'm also available for coffee chats, technical discussions, or just to connect 
              with fellow developers and tech enthusiasts.
            </p>
            <div className="flex flex-col sm:flex-row gap-4 justify-center">
              <a
                href="https://www.linkedin.com/in/divleen-lota/"
                target="_blank"
                rel="noopener noreferrer"
                className="bg-gradient-to-r from-accent-blue to-accent-purple text-white px-8 py-4 rounded-full text-lg font-semibold hover:shadow-xl hover:shadow-blue-500/25 transition-all duration-300 transform hover:scale-105"
              >
                Connect on LinkedIn
              </a>
              <a
                href="tel:+16692435546"
                className="border-2 border-accent-blue text-accent-blue px-8 py-4 rounded-full text-lg font-semibold hover:bg-accent-blue hover:text-white transition-all duration-300"
              >
                Call Directly
              </a>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Contact;
